def solve(string):
    unique = True
    for i in range(len(string)):
        for j in range(i+1, len(string)):
            if string[i] == string[j]:
                unique = False
                break
    return unique

def solve(string):
    unique = set(string)
    if len(unique) == len(string):
        return True
    else:
        return False

def solve(string):
    unique_chars = set()
    for char in string:
        if char in unique_chars:
            return False
        else:
            unique_chars.add(char)
    return True

